- Arrays of special supported pseudo-types (elemtyptype = ''c'' AND elemrelkind=''c'') -- Array of user-defined free-standing composites (not table composites) by default )) ORDER BY CASE WHEN typtype IN (''b'', ''e'', ''p'') THEN 0 -- First base types, enums, pseudo-types WHEN typtype = ''r'' THEN 1 -- Ranges after WHEN typtype = ''m'' THEN 2 -- Multiranges after WHEN typtype = ''c'' THEN 3 -- Composites after WHEN typtype = ''d'' AND elemtyptype <> ''a'' THEN 4 -- Domains over non-arrays after WHEN typtype = ''a'' THEN 5 -- Arrays after WHEN typtype = ''d'' AND elemtyptype = ''a'' THEN 6 -- Domains over arrays last END; -- Load field definitions for (free-standing) composite types SELECT typ.oid, att.attname, att.atttypid FROM pg_type AS typ JOIN pg_namespace AS ns ON (ns.oid = typ.typnamespace) JOIN pg_class AS cls ON (cls.oid = typ.typrelid) JOIN pg_attribute AS att ON (att.attrelid = typ.typrelid) WHERE (typ.typtype = ''c'' AND cls.relkind=''c'') AND attnum > 0 AND -- Don''t load system attributes NOT attisdropped ORDER BY typ.oid, att.attnum; -- Load enum fields SELECT pg_type.oid, enumlabel FROM pg_enum JOIN pg_type ON pg_type.oid=enumtypid ORDER BY oid, enumsortorder; '
